  \"Spatial ecology, dispersal patterns and monitoring methods for the Karner blue
  butterfly, Lycaides melissa samuelis on Necedah National Wildlife Refuge\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 21,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:42.183920\",\n\t\"name\": \"spatial-ecology-dispersal-patterns-and-monitoring-methods-for-the-karner-blue-butterfly-ly\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study discusses disperal research
  that was conducted on three sites on the Necedah National Wildlife Refuge during
  the summer of 1995. In addtion, three survey methods that are frequently used to
  survey butterfly populations were evaluated. Range-wide population declines of the
  Karner blue butterfly led to its listing as an endangered species in December 1992.
  The author believes there are significant information gaps regarding the ecology
  of the Karner blue butterfly; specifically, distribution and dispersal of individuals
  within populations. This study addresses these information gaps. Mark-release-recapture
  research was conducted to determine dispersal ability and patterns of Karner blue
  butterflies (Lycaides melissa samuelis). The observed dispersal trends indicate
  that Karner blue butterflies were able to disperse large distances frequently and
  they rarely use corridors to do it.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
